import * as fs from 'fs';
import * as path from 'path';
import { promisify } from 'util';
import mime from 'mime-types';

const readFileAsync = promisify(fs.readFile);

async function generateImageMap(
  inputDir: string,
  outputFile: string,
  defaultImage: string,
): Promise<void> {
  const imageMap: Record<string, string> = {};
  const rootDir = process.cwd();
  const resolvedInputDir = path.resolve(rootDir, inputDir);
  const resolvedOutputFile = path.resolve(rootDir, outputFile);

  for (let stage = 1; stage <= 10; stage++) {
    for (let level = 1; level <= 10; level++) {
      const stageDir = path.join(resolvedInputDir, `stage_${stage}`);
      const imagePath = path.join(stageDir, `level_${level}.webp`);

      try {
        const imageData = await readFileAsync(imagePath);
        const mimeType = mime.lookup(imagePath);
        const base64Image = `data:${mimeType};base64,${imageData.toString(
          'base64',
        )}`;
        imageMap[`level${stage}x${level}`] = base64Image;
      } catch (error) {
        // If the image doesn't exist or there's an error, use the default image
        imageMap[`level${stage}x${level}`] = defaultImage;
      }
    }
  }

  fs.writeFileSync(
    resolvedOutputFile,
    JSON.stringify(imageMap, null, 2),
    'utf-8',
  );
  console.log(`JSON file saved to ${resolvedOutputFile}`);
}

const inputDirectory = './assets/images/stages';
// if changed change also in .gitignore
const outputJSONFile = './assets/static/levelImages.json';

const defaultBase64Image =
  'data:image/jpeg;base64,';

generateImageMap(inputDirectory, outputJSONFile, defaultBase64Image)
  .then(() => console.log('Image map generation complete.'))
  .catch((error) => console.error('Error generating image map:', error));
